            <Grid spacing={2} >
                <Grid>
                <Link className="link" to="/about/company">Company</Link>
                </Grid>
                <Grid>
                <Link className="link" to="/about/jobs">Jobs</Link>
                </Grid>
                <Grid>
                <Link className="link" to="/about/jobs/edit">Edit Jobs</Link>
                </Grid>
            </Grid>
        </AppBar>
    );
  };


